import React from 'react'
import './App.css'

// eslint-disable-next-line
import { Article, Navbar } from './components'
// eslint-disable-next-line
import { About, Footer, Header, Home, Projects, Services, Contact } from './containers'

const App = () => {
  return (
    <div className='App'>
      <div className='gradient__bg'>
        <Navbar/>
        <Home/>
        {/* https://youtu.be/F627pKNUCVQ?t=4524 */}
      </div>

      <About/>
      <Projects/>
      <Services/>
      <Contact/>
      <Footer/>
    </div>
  )
}

export default App
